def gethashsha256(abc):
    tt = ctxsha256.call("hash", abc)
    return tt

def gethashmd5(abc):
    tt = ctxmd5.call("hash", abc)
    return tt   

def gethashsha1(abc):
    tt = ctxsha1.call("hash", abc)
    return tt 

def gethash(hash_type, abc):
    
    if hash_type == 'sha256':
        return gethashsha256(abc)
    elif hash_type == 'md5':
        return gethashmd5(abc)
    elif hash_type == 'sha1':
        return gethashsha1(abc)
    else:
        return "Invalid hash type"




if __name__=="__main__":
    url=r'https://paper.seebug.org/category/threat-intelligence/?page={}'.format(str(1))



    my_session = requests.session()
    my_session.headers.update({"User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, "
                                            "like Gecko) Chrome/75.0.3770.100 Safari/537.36"})

    # 第一步由__jsluid_s获取__jsl_clearance_s=, 通过第一步请求返回的js(称js1)计算而来
    r = my_session.get(url).text.replace("<script>document.cookie=", "").replace(";location.href=location.pathname+location.search</script>", "")
    default = execjs.get()
    res = default.eval(r)
    # print(res)

    # 第二步更新__jsl_clearance_s=, 由带__jsluid_s和旧的__jsl_clearance_s请求返回的js(称js2)计算而来
    # js2 主要功能有检测是否为webdriver等等, 以及更新__jsl_clearance_s
    # 更新js2 的算法目前发现有md5, sha1, sha256, 具体哪种由服务器随机返回, 目前仅实现sha256, 其它应该差不多
    my_session.headers.update({"Cookie": "__jsluid_s" + "=" + my_session.cookies.get("__jsluid_s") + ";" + res})
    r = my_session.get(url)
    # print(r.text)
    go_para = json.loads(r.text.split("}};go(")[1].replace(")</script>", ""))
    # print(go_para)

    # print("len(aaa):", len(go_para['chars']), "ct:", go_para['ct'], "ha:", go_para['ha'])

    
    print(f"{go_para['ha']}解密计算中")
    for i in range(0, len(go_para['chars'])):
        for j in range(0, len(go_para['chars'])):

            if gethash(go_para['ha'],go_para['bts'][0] + go_para['chars'][i] + go_para['chars'][j] + go_para['bts'][1] )== go_para['ct']:
                new_jslll = go_para['bts'][0] + go_para['chars'][i] + go_para['chars'][j] + go_para['bts'][1]

                my_session.headers.update({"Cookie": "__jsluid_s" + "=" + my_session.cookies.get("__jsluid_s") + ";" + "__jsl_clearance_s=" + new_jslll + ";max-age=3600;path=/"})
                r = my_session.get(url)

                result=r.text
                
                if '没有搜到Paper' in result:
                    break

                tree = etree.HTML(result)
                #//*[@id="wrapper"]/main/div/article[1]/header/h5/a
                xpath=tree.xpath(r'//*[@id="wrapper"]/main/div/article')
                if xpath is None:
                    exit("error-_-")
                    
                
                for i in xpath:
                    i=etree.HTML(etree.tostring(i).decode('utf-8'))
                    title =''.join(i.xpath(r'//header/h5/a/text()')).strip()
                    time_src =i.xpath(r'//header/section/span/time[2]')
                    href=r"https://paper.seebug.org"+''.join(i.xpath(r'//header/h5/a/@href')).strip()
                    row = "["  + title +"](" + href +")  \r"    
                    print(row)


                break
        else:
            continue
